function IconToggle() {
  const icons = [
    { name: 'settings', variant: 'default', icon: <IconBaselineDensityMedium style={{ width: '70%', height: '70%' }} stroke={1.5} /> },
    { name: 'other', variant: 'default', icon: <IconBaselineDensitySmall style={{ width: '70%', height: '70%' }} stroke={1.5} /> },
    { name: 'another', variant: 'default', icon: <IconAlignCenter style={{ width: '70%', height: '70%' }} stroke={1.5} /> },
    { name: 'another', variant: 'default', icon: <IconAlignJustified style={{ width: '70%', height: '70%' }} stroke={1.5} /> },
    { name: 'another', variant: 'default', icon: <IconAlignCenter style={{ width: '70%', height: '70%' }} stroke={1.5} /> },
    // Add more icons here if needed
  ];

  const toggleIconVariant = (iconName) => {
    const updatedIcons = icons.map((icon) => {
      if (icon.name === iconName) {
        return { ...icon, variant: icon.variant === 'default' ? 'Outline' : 'default' };
      }
      return icon;
    });
    // Replace the previous icons array with the updatedIcons array
    icons.length = 0;
    Array.prototype.push.apply(icons, updatedIcons);
  };

  return (
    <div>
      {icons.map((icon) => (
        <Icon
          key={icon.name}
          icon={icon.icon}
          variant={icon.variant}
          onClick={() => toggleIconVariant(icon.name)}
          label={icon.name}
        />
      ))}
    </div>
  );
}

